const cheerio = require('cheerio');

export default class FactoryDataFifaArena {
  static getGamesResult(data) {
    const $ = cheerio.load(data);
    const lines = [];

    $('table').each((i, element) => {
      if ($(element).find('caption').text().split('Cyber').length - 1 === 1) {
        $(element)
          .find('tbody')
          .find('tr')
          .each((index, tRow) => {
            console.log(tRow)
          });
      }
    });
    console.log(lines)
